import React, { useState } from 'react'
import Result from './Result';
import './index.css';
const Search=()=>{
    const [Text,setText]=useState();
    const fun=(p)=>{
        const val=p.target.value;
        setText(val);
    }
    return(
        <>
           <div className='Input'>
           <input type={"text"} placeholder="Search Anything" onChange={fun} value={Text}/> 
           </div>
           <Result/>
        </>
    );
}
export default Search;
